import React, { useEffect, useState } from 'react';

const DogList = () => {
    const [dogs, setDogs] = useState([]);
    const [criteria, setCriteria] = useState({
        state: '',
        minWeight: '',
        maxWeight: '',
        color: '',
        minAge: '',
        maxAge: ''
    });

    useEffect(() => {
        // Generate sample dog data with image URLs
        const sampleDogs = [
            { name: 'Dog 1', state: 'California', weight: 20, color: 'Brown', age: 3, image: 'https://img.freepik.com/free-photo/cute-shepherd-dog-posing-isolated-white-background_155003-46179.jpg?t=st=1708605222~exp=1708608822~hmac=faf9d53b3c2ec095399518160591a9334e67f3120dbe2c58b9aba628a75c5259&w=1060' },
            { name: 'Dog 2', state: 'New York', weight: 25, color: 'Black', age: 4, image: 'https://www.freepik.com/free-photo/shallow-focus-vertical-shot-cute-golden-retriever-puppy-sitting-grass-ground_12177096.htm#fromView=search&page=1&position=1&uuid=f70b9e96-3a6c-45e6-aaaf-830f8159d494' },
            { name: 'Dog 3', state: 'California', weight: 18, color: 'White', age: 2, image: 'https://www.freepik.com/free-photo/selective-focus-shot-adorable-golden-retriever-outdoors_17245319.htm#fromView=search&page=1&position=9&uuid=f70b9e96-3a6c-45e6-aaaf-830f8159d494' },
            { name: 'Dog 4', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://www.freepik.com/free-photo/portrait-cute-labrador-sitting-grass_5946021.htm#fromView=search&page=1&position=8&uuid=f70b9e96-3a6c-45e6-aaaf-830f8159d494' },
            { name: 'Dog 5', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://www.freepik.com/free-ai-image/cute-puppy-sitting-grass-looking-camera-generated-by-artificial-intellingence_77071610.htm#fromView=search&page=2&position=22&uuid=2e94580a-e08c-4eef-ae29-234742d95424' },
            { name: 'Dog 6', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://img.freepik.com/free-psd/adorable-white-bulldog-puppy-portrait_53876-74044.jpg?size=626&ext=jpg&uid=R136436511&ga=GA1.1.1720393731.1706527104&semt=sph'},
            { name: 'Dog 7', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://www.freepik.com/premium-ai-image/cute-white-dog-with-funny-expression-blue-background-studio-shot_139543583.htm#fromView=search&page=2&position=42&uuid=2e94580a-e08c-4eef-ae29-234742d95424' },
            { name: 'Dog 8', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://img.freepik.com/free-photo/black-labrador-retriever-standing-green-forest_23-2148045690.jpg?size=626&ext=jpg&uid=R136436511&ga=GA1.1.1720393731.1706527104&semt=sph' },
            { name: 'Dog 9', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://img.freepik.com/premium-photo/french-bulldog-18-months-old-sitting_191971-5291.jpg?size=626&ext=jpg&uid=R136436511&ga=GA1.1.1720393731.1706527104&semt=sph' },
            { name: 'Dog 10', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://via.placeholder.com/150' },
            { name: 'Dog 11', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://via.placeholder.com/150' },
            { name: 'Dog 12', state: 'Texas', weight: 22, color: 'Brown', age: 5, image: 'https://via.placeholder.com/150' }

        ];

        // Apply filters based on criteria
        const filteredDogs = sampleDogs.filter(dog => {
            return (
                (!criteria.state || dog.state === criteria.state) &&
                (!criteria.minWeight || dog.weight >= parseInt(criteria.minWeight)) &&
                (!criteria.maxWeight || dog.weight <= parseInt(criteria.maxWeight)) &&
                (!criteria.color || dog.color.toLowerCase() === criteria.color.toLowerCase()) &&
                (!criteria.minAge || dog.age >= parseInt(criteria.minAge)) &&
                (!criteria.maxAge || dog.age <= parseInt(criteria.maxAge))
            );
        });

        setDogs(filteredDogs);
    }, [criteria]); // Update dogs when criteria changes

    const handleAction = async (dogName, actionType) => {
        // Handle actions as needed
    };

    return (
        <div className="container">
            {dogs.map((dog, index) => (
                <div className="card_item" key={index}>
                    <div className="card_inner">
                        {/* Display dog details */}
                        <img src={dog.image} alt={dog.name} />
                        <div>Name: {dog.name}</div>
                        <div>State: {dog.state}</div>
                        <div>Weight: {dog.weight}</div>
                        <div>Color: {dog.color}</div>
                        <div>Age: {dog.age}</div>

                        {/* Add action buttons */}
                        <button className="actionButton" onClick={() => handleAction(dog.name, 'wag')}>Wag</button>
                        <button className="actionButton" onClick={() => handleAction(dog.name, 'growl')}>Growl</button>
                        <button className="actionButton" onClick={() => handleAction(dog.name, 'superwag')}>Super Wag</button>
                    </div>
                </div>
            ))}
        </div>
    );
}

export default DogList;
